import React,{useContext} from 'react'
import ListItems from './ListItems'
// import './style/list.css'
import TaskListContext from "./store/taskList-context"
function List(props) {
  const taskCtx = useContext(TaskListContext);

  return (
    <div className='card'>
    {taskCtx.items.map((i) => (
        <ListItems title={i.title} />
      ))}
    </div>
  )
}

export default List
